import React, { useState, useEffect } from 'react';

const App = () => {
  const [counter, setCounter] = useState(0);
  const [anthony, setAnthony] = useState('anthony');

  useEffect(() => {
    console.log('Hello log!');
  }, []);

  return (
    <>
      <h1>
        {counter}
        {anthony}
      </h1>
      <button onClick={() => setCounter(counter + 1)}>Increment</button>
    </>
  );
};

export default App;
